import React, { useState } from "react";
import "./Overview.css";
import Suggestion from "./Suggestion";
import WorkoutComp from "./Workout";
import Calories from "./Calories";
import Steps from "./Steps";
import Workout from "./Workout";

const Overview = () => {
  const [selectedComponent, setSelectedComponent] = useState(<InfoPage update={setSelectedComponent}/>);

  return <>{selectedComponent}</>;
};

export default Overview;

const InfoPage = ({updateFunction}) => {
  return (
    <>
      <div className="info-page">
        <div onClick={() => updateFunction(<Workout />)}><Suggestion /></div>
        <WorkoutComp />
        <Calories />
        <Steps />
        <div className="goal-process"></div>
      </div>
      <div className="schedule-page"></div>
    </>
  );
};
